import React from 'react';

const Products: React.FC = () => {
  return (
    <div className="space-y-6">
      <div>
        <h1 className="text-2xl font-bold text-gray-900">Products</h1>
        <p className="text-gray-600">Manage your product catalog and pricing.</p>
      </div>

      <div className="card p-8 text-center">
        <h3 className="text-lg font-medium text-gray-900 mb-2">Product Management</h3>
        <p className="text-gray-600">This module will include product CRUD operations, categories, pricing, and GST management.</p>
      </div>
    </div>
  );
};

export default Products;
